// AnesthesiaSecondYear.js
import React from 'react';
import FormComponentAnesthesia2 from '../../components/FormComponentAnesthesia';

const subjectsData = [
  { subject: 'Paper I - Pharmacology related to Anesthesia Technology', maxMarks: 80, minMarks: 40, marksSecured: 0 },
  { subject: 'Paper II - Pathology & Microbiology related to Anesthesia Technology', maxMarks: 80, minMarks: 40, marksSecured: 0 },
  { subject: 'Paper III - Applied Anatomy & Physiology related to Anesthesia Technology', maxMarks: 40, minMarks: 20, marksSecured: 0 },
  { subject: 'Practicals', maxMarks: 120, minMarks: 60, marksSecured: 0 },
];

const AnesthesiaSecondYear = () => {
  return (
    <FormComponentAnesthesia2
      title="Second Year B.Sc. Anesthesia Technology Marks Memo"
      subjectsData={subjectsData}
    />
  );
};

export default AnesthesiaSecondYear;
